import React from "react";
import ReactDOM from "react-dom";
import {add,sub,div,multi} from "./Calc";

ReactDOM.render(
  <>
    <ul>
      <li>Add of these number is {add(20,30)}</li>
      <li>Sub of these number is {sub(20,10)}</li>
      <li>Multiply of these number is {multi(20,10)}</li>
      <li>Divison of these number is {div(20,30)}</li>
    </ul>
  </>,
  document.getElementById("root")
);
